// 超时
func shiftingLetters1(S string, shifts []int) string {
	charArray := []byte(S)
	resultArray := make([]int, len(charArray))
	for k, v := range charArray {
		resultArray[k] = int(v)
	}
	for k, v := range shifts {
		if v >= 26 {
			shifts[k] = v - (v/26)*26
		}
	}
	now1 := time.Now()
	for k, v := range shifts {
		//t1 := time.Now()
		for j := 0; j <= k; j++ {
			resultArray[j] = resultArray[j] + v
			if resultArray[j] > 122 {
				resultArray[j] = resultArray[j] - 26
			}
		}
		//t2 := time.Now()
		//fmt.Println(t2.Sub(t1))
	}
	now2 := time.Now()
	fmt.Println(now2.Sub(now1))
	var result []string
	for _, v := range resultArray {
		sprint := fmt.Sprintf("%c", v)
		result = append(result, sprint)
	}
	join := strings.Join(result, "")
	return join
}

func shiftingLetters(S string, shifts []int) string {
	now1 := time.Now()
	s := []byte(S)
	shifts = append(shifts, 0)
	for i := len(s) - 1; i >= 0; i-- {
		shifts[i] = (shifts[i] + shifts[i+1]) % 26
		s[i] = 'a' + (s[i]-'a'+byte(shifts[i]))%26
	}
	now2 := time.Now()
	fmt.Println(now2.Sub(now1))
	return string(s)
}
